import { Component } from "react";
import './Footer.css'
class Footer extends Component{
    render(){
        return(
            <div className="container-fluid style">
                
                <p className="  text-white text-center py-3" >&copy; 2024 All Rights Reserved. </p>
                
            </div>
 
        );
    }
}

export default Footer
